import React, { useState } from 'react';
import { Container, Box, Typography, MenuItem, Select, Button, List, ListItem, ListItemText, IconButton, Grid, Radio, RadioGroup, FormControlLabel, Paper, Divider, LinearProgress } from '@mui/material';
import { Visibility, Delete, Download } from '@mui/icons-material';
import NavBar from './NavBar';

const defaultFiles = {
  caseSample: ['default_case_sample_1', 'default_case_sample_2'],
  controlSample: ['default_control_sample_1', 'default_control_sample_2'],
  proteinSequence: ['default_protein_sequence_1', 'default_protein_sequence_2']
};

const Pipeline = () => {
  const [algorithm, setAlgorithm] = useState('');
  const [files, setFiles] = useState({
    caseSample: [],
    controlSample: [],
    proteinSequence: [],
  });
  const [fileSources, setFileSources] = useState({
    caseSample: 'local',
    controlSample: 'local',
    proteinSequence: 'local',
  });
  const [uploadedFiles, setUploadedFiles] = useState([]);
  const [uploadProgress, setUploadProgress] = useState({});

  const handleAlgorithmChange = (event) => {
    setAlgorithm(event.target.value);
  };

  const handleFileChange = (event) => {
    const { name, files: selectedFiles } = event.target;
    const updatedFiles = { ...files, [name]: [...files[name], ...Array.from(selectedFiles)] };
    setFiles(updatedFiles);

    Array.from(selectedFiles).forEach((file) => {
      const reader = new FileReader();
      reader.onloadend = () => {
        const resultFile = { name: file.name, size: file.size, content: reader.result };
        setUploadedFiles((prev) => [...prev, resultFile]);
        setUploadProgress((prev) => ({ ...prev, [file.name]: 100 }));
      };

      reader.readAsDataURL(file);

      setUploadProgress((prev) => ({ ...prev, [file.name]: 0 }));
    });
  };

  const handleDefaultFileSelect = (name, file) => {
    const updatedFiles = { ...files, [name]: [...files[name], { name: file, size: null }] };
    setFiles(updatedFiles);
    setUploadedFiles((prev) => [...prev, { name: file, size: null }]);
  };

  const handleFileSourceChange = (event, fileType) => {
    setFileSources({ ...fileSources, [fileType]: event.target.value });
    setFiles({ ...files, [fileType]: [] });
    setUploadedFiles((prev) => prev.filter((f) => !files[fileType].includes(f)));
  };

  const handleRun = () => {
    // 在这里处理运行逻辑
    console.log('Running with:', algorithm, files);
  };

  const handleReset = () => {
    setAlgorithm('');
    setFiles({
      caseSample: [],
      controlSample: [],
      proteinSequence: [],
    });
    setFileSources({
      caseSample: 'local',
      controlSample: 'local',
      proteinSequence: 'local',
    });
    setUploadedFiles([]);
    setUploadProgress({});
  };

  const handleFileDelete = (file) => {
    setUploadedFiles(uploadedFiles.filter((f) => f !== file));
    setFiles((prev) => {
      const updatedFiles = { ...prev };
      Object.keys(updatedFiles).forEach(key => {
        updatedFiles[key] = updatedFiles[key].filter((f) => f.name !== file.name);
      });
      return updatedFiles;
    });
  };

  const handleFileView = (file) => {
    alert(`Viewing file: ${file.name || file}`);
  };

  const handleFileDownload = (file) => {
    const element = document.createElement("a");
    element.href = file.content;
    element.download = file.name;
    document.body.appendChild(element);
    element.click();
    document.body.removeChild(element);
  };

  const formatFileSize = (size) => {
    if (size === null) return '';
    const i = Math.floor(Math.log(size) / Math.log(1024));
    return `${(size / Math.pow(1024, i)).toFixed(2)} ${['B', 'KB', 'MB', 'GB', 'TB'][i]}`;
  };

  return (
    <>
      <NavBar />
      <Container component="main" maxWidth="md">
        <Box sx={{ marginTop: 8, display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
          <Box sx={{ mt: 3, mb: 5, width: '100%' }}>
            <Paper elevation={3} sx={{ p: 3, backgroundColor: '#ffffff', mb: 5, position: 'relative', border: '1px solid #ccc' }}>
              <Typography variant="h6" sx={{ position: 'absolute', top: -20, left: 16, backgroundColor: '#ffffff', px: 1 }}>
                Algorithm Selection
              </Typography>
              <Select
                fullWidth
                value={algorithm}
                onChange={handleAlgorithmChange}
                displayEmpty
                sx={{ mt: 3, mb: 3, height: 50 }}
              >
                <MenuItem value="" disabled>Select an algorithm</MenuItem>
                <MenuItem value="PIWAS">PIWAS</MenuItem>
                <MenuItem value="PIE">PIE</MenuItem>
                <MenuItem value="PIWAS+PIE">PIWAS+PIE</MenuItem>
              </Select>
            </Paper>

            <Paper elevation={3} sx={{ p: 3, backgroundColor: '#ffffff', mb: 5, position: 'relative', border: '1px solid #ccc' }}>
              <Typography variant="h6" sx={{ position: 'absolute', top: -20, left: 16, backgroundColor: '#ffffff', px: 1 }}>
                Upload Files
              </Typography>
              {['caseSample', 'controlSample', 'proteinSequence'].map((fileType, index) => (
                <Box key={index} sx={{ mt: 2 }}>
                  <Typography>{fileType.replace(/([A-Z])/g, ' $1').replace(/^./, str => str.toUpperCase())}</Typography>
                  <Grid container spacing={2} alignItems="center">
                    <Grid item xs={6}>
                      <RadioGroup
                        row
                        name={fileType}
                        value={fileSources[fileType]}
                        onChange={(e) => handleFileSourceChange(e, fileType)}
                      >
                        <FormControlLabel value="local" control={<Radio />} label="Upload from local" />
                        <FormControlLabel value="default" control={<Radio />} label="Select default file" />
                      </RadioGroup>
                    </Grid>
                    <Grid item xs={6}>
                      {fileSources[fileType] === 'local' ? (
                        <input
                          type="file"
                          name={fileType}
                          multiple
                          onChange={handleFileChange}
                          style={{ display: 'block', marginTop: '10px' }}
                        />
                      ) : (
                        <Select
                          fullWidth
                          displayEmpty
                          onChange={(event) => handleDefaultFileSelect(fileType, event.target.value)}
                          value={files[fileType] || ''}
                          sx={{ height: 40 }}
                        >
                          <MenuItem value="" disabled>Select a default file</MenuItem>
                          {defaultFiles[fileType].map((file, index) => (
                            <MenuItem key={index} value={file}>{file}</MenuItem>
                          ))}
                        </Select>
                      )}
                    </Grid>
                  </Grid>
                </Box>
              ))}
            </Paper>

            <Paper elevation={3} sx={{ p: 3, backgroundColor: '#ffffff', position: 'relative', border: '1px solid #ccc' }}>
              <Typography variant="h6" sx={{ position: 'absolute', top: -20, left: 16, backgroundColor: '#ffffff', px: 1 }}>
                Uploaded Files
              </Typography>
              <List sx={{ mt: 3 }}>
                {uploadedFiles.map((file, index) => (
                  <React.Fragment key={index}>
                    <ListItem>
                      <ListItemText
                        primary={file.name || file}
                        secondary={file.size !== undefined ? formatFileSize(file.size) : ''}
                      />
                      <IconButton edge="end" aria-label="download" onClick={() => handleFileDownload(file)}>
                        <Download />
                      </IconButton>
                      <IconButton edge="end" aria-label="view" onClick={() => handleFileView(file)}>
                        <Visibility />
                      </IconButton>
                      <IconButton edge="end" aria-label="delete" onClick={() => handleFileDelete(file)}>
                        <Delete />
                      </IconButton>
                    </ListItem>
                    {uploadProgress[file.name] !== undefined && (
                      <Box sx={{ width: '100%' }}>
                        <LinearProgress variant="determinate" value={uploadProgress[file.name]} />
                      </Box>
                    )}
                    {index < uploadedFiles.length - 1 && <Divider />}
                  </React.Fragment>
                ))}
              </List>
            </Paper>

            <Box sx={{ mt: 3, display: 'flex', justifyContent: 'space-between' }}>
              <Button variant="contained" color="primary" onClick={handleRun}>
                Run
              </Button>
              <Button variant="outlined" color="secondary" onClick={handleReset}>
                Reset
              </Button>
            </Box>
          </Box>
        </Box>
      </Container>
    </>
  );
};

